import React from "react";
import { NavLink } from "react-router-dom";
const Header = () => {
    return <div>
    <h1 className="header">Yoga App</h1>
    <div className="nav-link">
        <NavLink to="/" active>
          Form
        </NavLink>
        <NavLink to="/payment" >
          Payment
        </NavLink>
</div>
</div>
}

export default Header;
